(function() {
    'use strict';
    angular.module('routerApp.about')
        .controller('routerApp.about.AboutController', AboutController);

    AboutController.$inject = [
        '$window',
        'FileSaver',
        'routerApp.core.CoreService',
        'routerApp.core.CoreFactory'
    ];

    function AboutController($window, FileSaver, CoreService, CoreFactory) {
        var vm = this;
        vm.test = test;
        vm.scotches = [
            {
                name: 'Macallan 12',
                price: 50
            },
            {
                name: 'Chivas Regal Royal Salute',
                price: 10000
            },
            {
                name: 'Glenfiddich 1937',
                price: 20000
            }
        ];
        function test() {
            var documentData = '';


            var byteCharacters = atob(documentData);

            var byteNumbers = new Array(byteCharacters.length);
            for (var i = 0; i < byteCharacters.length; i++) {
               byteNumbers[i] = byteCharacters.charCodeAt(i);
            }

            var byteArray = new Uint8Array(byteNumbers);

            var blob = new Blob([byteArray], {
               type: 'application/pdf'
            });
            var objectUrl = URL.createObjectURL(blob);

            if (navigator.vendor.indexOf("Apple") !== -1) {
               FileSaver.saveAs(blob, 'text.pdf');
               console.log('test');
               return;
            }        

            if ($window.navigator && $window.navigator.msSaveOrOpenBlob) {
               $window.navigator.msSaveOrOpenBlob(blob);
            } else {
               $window.open(objectUrl);
            }
        }
    }
}());